import React from "react";
import GetValue from "./components/GetValue";
import Layout from "./components/Layout";
import { apiEndPoint } from "./config";

const App = () => {
  let artistInfo = {
    details: {},
    events: []
  };

  const getDetails = async fieldValue => {
    const response = await fetch(
      apiEndPoint + "/artists/" + this.state.fieldValue + "?app_id=app_id"
    );
    const myData = await response.json();
    artistInfo.details = myData;
    console.log(myData);
    // const url = `${apiEndPoint}/artists/${fieldValue}/events?app_id=app_id`;
    // const response = await fetch(url);
    // const myData = await response.json();
    // console.log(myData);
  };

  console.log(artistInfo.details);

  return (
    <React.Fragment>
      <GetValue onFetch={getDetails} />
      <Layout />
    </React.Fragment>
  );
};

export default App;
